import React, { useEffect } from "react";
import { tsConstructorType } from "@babel/types";

const App = () => {
  class voiture {
    Constructor(color, marque) {
      (this.color = color), (this.marque = marque);
    }
    show() {
      console.log(`${this.color} is my ${this.marque}`);
    }
  }
  const ok = new voiture("blue", "seat");
  ok.show();

  return (
    <>
      <div className="container">
        <h1>Hello</h1>
        <button>OK</button>
      </div>
    </>
  );
};

export default App;
